import React from 'react'
import '../assets/css/Error.css'
import Img2574 from '../assets/img/Grupo 2574@2x.png'

function Error() {
  return (
    <div className='ErrorBody'>
        <img src={Img2574} alt="" />
    </div>
  )
}

export default Error
